<?php

/** @var \Illuminate\Database\Eloquent\Factory $factory */

use App\Article;
use Faker\Generator as Faker;

$factory->defineAs(Article::class, 'GenerateArticles', function (Faker $faker) {
    return [
        'title' => $faker->name, 
        'description' => $faker->text,
        'preview' => 'data:image/png;base64,',
    ];
});
